function Signup() {
  return (
    <div className="flex flex-col justify-start items-center bg-green-100">
      <div className="w-[321px] h-[30px] mt-[158px] text-[26px] text-[#000000] font-semibold">
        메타마스크 간편하게 가입해요.
        <div className="absolute w-[300px] h-[60px] mt-[206px] text-[20px] font-light bg-red-400">
          <div className="flex justify-center flex-col items-center ">
            <div>배불럭은 이더리움의 스마트컨트랙트를 활용한</div>
            <div>새로운 배달앱 입니다!</div>
            <div>고객님은 저렴한 배달료로 맛있게 즐길 수 있어요!</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Signup;
